Mongodb Aggregate : replace value of one collection with matching value of other collection<p>I am new to MongoDB, I have two collections like this :</p>

<p><strong>1st collection name is a</strong></p>

<p>db.a.find()</p>

<pre><code>{
"_id": "1234",
"versions": [{
        "owner_id": ObjectId("100000"),
        "versions": 1,
        "type" : "info",
        "items" : ["item1","item3","item7"]
    },
    {
        "owner_id": ObjectId("100001"),
        "versions": 2,
        "type" : "bug",
        "OS": "Ubuntu",
        "Dependencies" : "Trim",
        "items" : ["item1","item7"]
    }
]}
</code></pre>

<p><strong>2nd Collection name is b</strong></p>

<p>db.b.find()</p>

<pre><code> {
    "_id": ObjectId("100000"),
    "email": "abc@xyz.com"
  } {
    "_id": ObjectId("100001"),
    "email": "bbc@xyz.com"
 }
</code></pre>

<p>Expected output is:   </p>

<pre><code>{
"_id": "1234",
"versions":[{

        "owner_id": "abc@xyz.com",
        "versions": 1,
        "type" : "info",
        "items" : ["item1","item3","item7"]
    },
    {
        "owner_id": "bbc@xyz.com",
        "versions": 2,
        "type" : "bug",
        "OS": "Ubuntu",
        "Dependencies" : "Trim",
        "items" : ["item1","item7"]
    }
] }
</code></pre>

<p>Requirement: fields inside each document of <strong>versions</strong> are not fixed, 
Example : <strong>versions[0]</strong> have 4 key-value pair and <strong>versions[1]</strong> have 6 key-value pair.
so I am looking a query which can replace  <strong>owner_id</strong> with <strong>email</strong> keeping all other filed in output.</p>

<p>I tried : </p>

<pre><code>db.a.aggregate(
    [
        {$unwind:"$versions"},
        {$lookup : {from : "b", "localField":"versions.owner_id", "foreignField":"_id", as :"out"}}, 
        {$project : {"_id":1, "versions.owner_id":{$arrayElemAt:["$out.email",0]}}},
        {$group:{_id:"$_id", versions : {$push : "$versions"}}}
    ]   
).pretty()
</code></pre>

<p>Please help.</p>

<p>Thank You!!!</p>

