Possible to exclude nested fields in MongoDB with a wildcard?<p>Suppose I have a document:</p>

<pre><code>{
   "_id": "123",
   "fruit": {
     "apple": {
       "species": "Malus pumila",
       "taste": "Not bad"
     },
     "orange": {
       "species": "Citrus sinensis",
       "taste": "Pretty good"
     }
   }
}
</code></pre>

<p>I would like to do something along the lines of <code>db.food.find({}, {"fruit.*.taste": 0})</code> to not include the taste field in the query results:</p>

<pre><code>{
   "_id": "123",
   "fruit": {
     "apple": {
       "species": "Malus pumila"
     },
     "orange": {
       "species": "Citrus sinensis"
     }
   }
}
</code></pre>

<p>Is such a thing possible either through a traditional query or the aggregation pipeline?</p>

