Efficient way to Increment and push new value in document inside of a collection using Mongoose<p>I want to save new doc if it not present in the collection based on words and if it is present then want to increase its count by 1 and push a new value inside of page. This one is working but i want more efficient way to do this.</p>

<p>My Current Approach: I think i am not efficient with my Code</p>

<pre><code>my_model = new mongoose.Schema({
word: String,
count: Number,
page: [String]
});
</code></pre>

<p>// assume nextWord is a word coming from a wordArrayList using async.eachSeries and the below code will run for each nextWord and nextPage is the nextPage is the page which contains this nextWord</p>

<pre><code>my_model.find({word: nextWord}, function(err, data){
if(data.length&gt;0){
    my_model.findOneAndUpdate({word:nextWord},{$inc:{count:1}, $push:
    {page:nextPage}},{upsert:true}, function(err, doc){
        if(err) throw err;
        console.log('updated!');
    });
}
else
{
    var newModelObj = new my_model({
        word: nextWord,
        count: 1,
        page:[nextPage]
    });
    newModelObj.save(function(err){
        if(err) throw err;
        console.log('saved');
    });
}
})
</code></pre>

