Add All Clicks to One Document not each Have its own Document<p>When I run this code I get feedback that A click has been added to the database, which is good. The problem is every time I click it creates a separate document for each click. Ultimately I want each clicks to be in the same document under a collection. What do I need to put in my code or what do I need to run in the terminal. Thanks.</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>console.log('Server-side code running');

const express = require('express');
const MongoClient = require('mongodb').MongoClient;

const app = express();


app.use(express.static('public'));


let db;


const url =  'mongodb://localhost:27017/clicks';

MongoClient.connect(url, (err, database) =&gt; {
  if(err) {
    return console.log(err);
  }
  db = database;
  // start the express web server listening on 8080
  app.listen(8080, () =&gt; {
    console.log('listening on 8080');
  });
});


app.get('/', (req, res) =&gt; {
  res.sendFile(__dirname + '/index.html');
});


app.post('/clicked', (req, res) =&gt; {
  const click = {clickTime: new Date()};
  console.log(click);
  console.log(db);

  db.collection('clicks').save(click, (err, result) =&gt; {
    if (err) {
      return console.log(err);
    }
    console.log('click added to db');
    res.sendStatus(201);
  });
});


app.get('/clicks', (req, res) =&gt; {
  db.collection('clicks').find().toArray((err, result) =&gt; {
    if (err) return console.log(err);
    res.send(result);
  });
});</code></pre>
</div>
</div>
</p>

