<p>I have to make a an aggregation to calculate some weight for each element of the myArrayField :</p>

<pre><code>db.col.aggregate([{'$addFields':{
'myArray':{  
      '$concatArrays':[      
          {'$map':{
              'input':'$myArray',
              'as':'val',
              'in':{'value':'$$val.value','weight': X }
            }}
        ]} 
   ,
  'size':{'$size':'$myArray'}  
  }
},
{'$sort':{'size':-1}}
])
